import * as React from 'react';
import store from '../store/store';

function BoxList(props:any) {

    let showList: string[] = [];
    store.getState().map((box: { R: number; G: number; B:number; }) => {
        showList.push(`<div style={{background-color: rgb:(${box.R}, ${box.G}, ${box.B})}} className="box"></div>`);
        return 0;
    })

    return (
        <div className='box-list'>
            {showList}
        </div>
     );
}

export default BoxList;
